    "Advanced Composite Thrust Chambers for the Altair Lunar Lander Project",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:53:38.149713",nt"name": "advanced-composite-thrust-chambers-for-the-altair-lunar-lander-project-450a5",nt"isopen":
    true,nt"url": null,nt"notes": "Radiation-cooled, bipropellant thrusters
    are being considered for the Ascent Module main engine of the Altair Lunar Lander.
     Currently, iridium-lined rhenium combustion chambers are the state-of-the-art
    for radiatively cooled thrusters.  To increase the performance of radiation-cooled
    engines, improved chamber materials are needed that will allow higher operating
    temperatures, better resistance to oxidation, and reduce mass.  During this effort,
    an innovative composite thrust chamber is being developed that will incorporate
    advanced ceramic oxide and iridium liner techniques as well as replacing the expensive,
    high density rhenium with a low mass carbon-carbon composite.  The Phase I results
    have demonstrated the potential of combining innovative fabrication techniques to
    produce an advanced ceramic-Ir lined C-C thrust chamber. Hot gas testing has shown
    the ability of the ceramic oxide coating to reduce the exterior temperature of the
    C-C jacket, which will enable the use of higher temperature propellants for improved
    performance.  No damage was observed in the ceramic-Ir liner as a result of hot
    gas testing.  During Phase II, the techniques will be optimized to allow fabrication
    of a 3000 lbf chamber that will be delivered to NASA-MSFC for hot-fire testing.",nt"license_title":
